IFNULL((SELECT vs.up_vote FROM votes vs where vs.post_based_id = p.id and vs.up_vote = \'31\' order by vs.id limit 1),0) as up_vote_user_id,
IFNULL((SELECT vs1.down_vote FROM votes vs1 where vs1.post_based_id = p.id and vs1.down_vote = \'31\' order by vs1.id limit 1),0) as down_vote_user_id , h.name as hash_tag_name
FROM 
	posts p,users u ,hashtags h
where
    p.user_id = u.id 
    AND p.del_status = 1
    
    AND h.id = \'31\' AND h.post_id = p.id
	
	
    AND NOT FIND_IN_SET(\'31\',p.hide) <> 0
    ORDER BY p.id DESC LIMIT 0, 9 '
