IFNULL((SELECT vs1.down_vote FROM votes vs1 where vs1.post_based_id = p.id and vs1.down_vote = \'41\' order by vs1.id limit 1),0) as down_vote_user_id , h.name as hash_tag_name
FROM 
	posts p,users u ,hashtags h
where
    p.user_id = u.id 
    AND p.del_status = 1
    
    AND h.id = \'34\' AND h.post_id = p.id
	
	
